function Form(){
    return(
        <form>
          <label>First Name:</label>
          <input type="text" />
          <label>Last Name:</label>
          <input type="text" />
          <label> Location:</label>
          <input type="text" />
          <label>:</label>
          <input type="text" />
          <label>Gmail:</label>
          <input type="gmail" />
          <label>D.O.B:</label>
          <input type="date"/>


        </form>
    );
}export default Form;
